import React, { Component } from 'react';
import './results.css';

class results extends Component {
  constructor() {
    super();
    this.state = {
      results: []
    };
  }

  componentDidMount() {
    fetch('/api/results')
      .then(res => res.json())
      .then(results => this.setState({results}, () => console.log('Results fetched...', results)));
  }

  render() {
    return (
      <div>
      </div>
    );
  }
}

export default results;
